/*

Adds more app icons to the main menu

 */

import {OdooApps} from "../services/apps.mjs";

const ADD_MENU_ITEMS = [
    {
        'icon_data': 'data:image/png;base64,',
        'xml_request_id': 'sale.menu_product_template_action'
    },
    {
        'icon_data': 'data:image/png;base64,',
        'xml_request_id': 'base.menu_action_res_users'
    },
    {
        'icon_data': 'data:image/png;base64,',
        'xml_request_id': 'base.menu_action_ui_view'
    },
    {
        'icon_data': 'data:image/png;base64,',
        'xml_request_id': 'base.ir_model_model_menu'
    }
];

let createAppBoxElement = () => {
    let app_box = document.createElement("div");
    app_box.role = "option";
    app_box.id = "odoo_debug_additional_apps";
    app_box.className = "o_apps row user-select-none mt-5";
    return app_box;
}

let createAppElement = (title, src, xml_id, href) => {
    let app_element = document.createElement("a");
    app_element.role = "option";
    app_element.className = "o_app o_menuitem col-4 col-sm-3 col-md-2 p-2 mb-3 d-flex flex-column rounded justify-content-center align-items-center";
    app_element.ariaSelected = "false";
    app_element.href = href;
    app_element.setAttribute("data-menu-xmlid", xml_id);

    let app_image = createAppImageElement(src);
    let app_title = createAppTitleElement(title);

    app_element.appendChild(app_image);
    app_element.appendChild(app_title);
    return app_element;
}

let createAppImageElement = (src) => {
    let app_image = document.createElement("img");
    app_image.className = "o_app_icon rounded";
    app_image.src = src;
    return app_image;
}

let createAppTitleElement = (title) => {
    let app_title = document.createElement("div");
    app_title.className = "o_caption w-100 text-center text-truncate mt-2";
    app_title.innerHTML = title;
    return app_title;
}

let getToLoadMenuData = () => {
    const odoo_menu_items = OdooApps.getAllOdooMenuItems();
    let to_load = [];
    for(let app of ADD_MENU_ITEMS){
        for(let odoo_menu_item of odoo_menu_items){
            if(odoo_menu_item.xmlid === app.xml_request_id){
                to_load.push({'odoo_app': odoo_menu_item, 'icon': app.icon_data});
            }
        }
    }
    return to_load;
}

let isAppMenu = () => {
    let app_listbox = document.querySelectorAll('o_apps[role="listbox"]');
    return !!app_listbox;
}

let alreadyCreated = () => {
    let odoo_debug_additional_apps = document.getElementById('odoo_debug_additional_apps');
    return !!odoo_debug_additional_apps;
}

let loadAppMenus = () => {
    /* Load the apps if no apps are opened */
    if((!OdooApps.isHomeMenu()) || !isAppMenu() || alreadyCreated()){
        return;
    }
    let to_load_menus = getToLoadMenuData();
    let app_box = createAppBoxElement();
    for(let to_load_menu of to_load_menus){
        let href = `#menu_id=${to_load_menu.odoo_app.id}&amp;action_id=${to_load_menu.odoo_app.actionID}`;
        let app_element = createAppElement(to_load_menu.odoo_app.name, to_load_menu.icon, to_load_menu.odoo_app.xmlid, href);
        app_box.appendChild(app_element);
    }
    // Inject into the DOM if possible
    let listbox = document.querySelector(".o_apps[role='listbox']");
    listbox.insertAdjacentElement('afterend', app_box);
}


export const DebugApps = {
    loadAppMenus: loadAppMenus
};